pragma solidity >=0.5.0 <0.9.0;

import "./Company.sol";
import "./User.sol";

contract Transfer
{
    mapping(string => Company) public companies;
    mapping(address => User) public users;
    string[] public companySymbols;

    function getCompanies(string memory symbol) public view returns (Company) {
        return companies[symbol];
    }

    function getUsers(address user) public view returns (User) {
        return users[user];
    }

    function getUsersStockBalance(address user, string memory symbol) public view returns (uint) {
        return users[user].getStockValue(symbol);
    }
    
    function getUsersBuyOrderQuantity(address user, string memory symbol) public view returns (uint) {
        return users[user].getBuyOrderQuantity(symbol);
    }

    function getUsersBuyOrderPrice(address user, string memory symbol) public view returns (uint) {
        return users[user].getBuyOrderPrice(symbol);
    }

    function getCompanySymbol(uint index) public view returns (string memory) {
        return companySymbols[index];
    }
    
    function compareStrings(string memory a, string memory b) public pure returns (bool) 
    {
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))));
    }
    
    modifier costs(uint price) 
    {
      if (msg.value >= price) {_;}
    }
    
    modifier companyIsNew(string memory _symbol)
    {
        Company comp = Company(companies[_symbol]);
        
        require(!compareStrings(comp.symbol(),_symbol),"ISSUE WITH NEW COMPANY");
        
        if (!compareStrings(comp.symbol(),_symbol)) {_;}
        //if (!compareStrings(companies[_symbol].symbol, _symbol)) {_;}
    }
    
    modifier userNotNew()
    {
        if (users[msg.sender].owner() == msg.sender) {_;}
    }
    
    function companyNew(string memory _symbol) public view returns (bool)
    {
        bool isNew = true;
        
        for (uint i = 0; i < companySymbols.length; i++)
        {
            if (compareStrings(_symbol, companySymbols[i]))
            {
                isNew = false;
                break;
            }
        }
        
        return isNew;
    }
    
    function toUpper(string memory str) internal pure returns (string memory) {
        bytes memory bStr = bytes(str);
        bytes memory bUpper = new bytes(bStr.length);
        for (uint i = 0; i < bStr.length; i++) {
            // Uppercase character...
            if ((uint8(bStr[i]) >= 65) && (uint8(bStr[i]) <= 90))
                bUpper[i] = bStr[i];
            // Lowercase - make upper by -32
            else 
                bUpper[i] = bytes1(uint8(bStr[i]) - 32);
        }
        return string(bUpper);
    }
    
    function changeOwnership(string memory _symbol, address _newOwner) public returns(address)
    {
        string memory sym = toUpper(_symbol);
        require(!companyNew(sym),"Company does not exist");
        address newOwner = companies[sym].changeOwnership(msg.sender,_newOwner);
        return newOwner;
    }
    
    // new Company 
     function newIPO(string memory _symbol, uint _issued, uint _float) public
     {
        string memory upperStr = toUpper(_symbol);
        require(companyNew(upperStr),"Company already exists");
        companySymbols.push(upperStr);
        companies[upperStr] = new Company(msg.sender,upperStr,_issued,_float);
     }
     
     // UPDATE - check if buy amount requested is actually valid from company
    // user buy request with price limit
    function buyRequest(string memory _symbol, uint _quantity, uint _priceLimit) public
    {
        string memory sym = toUpper(_symbol);
		require(!companyNew(sym),"Company does not exist");
        
        if(address(users[msg.sender]) == address(0))
			users[msg.sender] = new User(msg.sender);

		users[msg.sender].addBuyRequest(sym,_quantity,_priceLimit);
    }
    
    function getPortfolio(string memory _symbol) public view returns(string memory)
	{
		string memory sym = toUpper(_symbol);
		require(address(users[msg.sender]) != address(0),"Address is not associated with an account");
	
		return users[msg.sender].getPortfolioInfo(sym);
	}
    
    // user sell request with price limit
    function sellRequest(string memory _symbol, uint _quantity, uint _priceLimit) public
    {
        require(address(users[msg.sender]) != address(0),"Address is not associated with an account");
        users[msg.sender].addSellRequest(_symbol,_quantity,_priceLimit);
    }
}
